import React from 'react'
import { Text, StyleSheet } from 'react-native'

const HeadingText = ({ children, style }) => {
  return <Text style={[styles.text]}>{children}</Text>
}

const styles = StyleSheet.create({
  text: {
    fontFamily: 18,
  },
})

export default HeadingText
